import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import {
  Container,
  Typography,
  Box,
  Grid,
  CircularProgress,
  Avatar,
  LinearProgress,
} from "@mui/material";
import Rating from "@mui/material/Rating";
import { getProductReviews } from "../../redux/actions/productActions";
import { format } from "date-fns";
import theme from "../../theme/theme";

const ProductReviewView = ({ productId }) => {
  const dispatch = useDispatch();
  const { reviews, loading, error } = useSelector(
    (state) => state.productReviews
  );

  useEffect(() => {
    dispatch(getProductReviews(productId));
  }, [dispatch, productId]);

  const getAverageRating = () => {
    if (reviews.length === 0) return 0;
    const sum = reviews.reduce((acc, review) => acc + review.rating, 0);
    return (sum / reviews.length).toFixed(1);
  };

  const ratingCounts = [1, 2, 3, 4, 5].reduce((acc, rating) => {
    acc[rating] = reviews.filter((review) => review.rating === rating).length;
    return acc;
  }, {});

  return (
    <Container>
      {loading ? (
        <CircularProgress />
      ) : error ? (
        <Typography variant="body1" color="error">
          {error}
        </Typography>
      ) : reviews.length === 0 ? (
        <Typography variant="body1" color="textSecondary">
          No reviews found
        </Typography>
      ) : (
        <>
          <Typography variant="h4">{getAverageRating()}</Typography>
          <Rating
            name="read-only"
            value={parseFloat(getAverageRating())}
            readOnly
            size="large"
          />
          <Typography variant="body1">({reviews.length} Ratings)</Typography>

          {[5, 4, 3, 2, 1].map((rating) => (
            <Box key={rating} display="flex" alignItems="center" my={1}>
              <Typography>{rating} â˜…</Typography>
              <LinearProgress
                variant="determinate"
                value={(ratingCounts[rating] / reviews.length) * 100}
                sx={{ width: "80%", mx: 2 }}
              />
              <Typography>
                {((ratingCounts[rating] / reviews.length) * 100).toFixed(0)}%
              </Typography>
            </Box>
          ))}

          <Grid container spacing={2} mt={2}>
            {reviews.map((review) => (
              <Grid item xs={12} key={review._id}>
                <Box
                  sx={{
                    border: `1px solid ${theme.palette.lightgrey.main}`,
                    borderRadius: "8px",
                    padding: "10px",
                    marginBottom: "16px",
                  }}
                >
                  <Box display="flex" alignItems="center">
                    <Avatar variant="rounded">
                      {review.userId.username.charAt(0).toUpperCase()}
                    </Avatar>
                    <Box ml={2}>
                      <Rating
                        name="read-only"
                        value={review.rating}
                        readOnly
                        size="small"
                      />
                      <Typography variant="subtitle2">
                        {review.userId.username}
                        <span
                          style={{
                            color: theme.palette.grey.main,
                            marginLeft: "10px",
                          }}
                        >
                          {format(new Date(review.createdAt), "dd MMM yyyy")}
                        </span>
                      </Typography>
                    </Box>
                  </Box>
                  <Typography variant="body1" mt={1}>
                    {review.comment}
                  </Typography>
                </Box>
              </Grid>
            ))}
          </Grid>
        </>
      )}
    </Container>
  );
};

export default ProductReviewView;
